import { Chrono } from 'react-chrono';

const events = [
  {
    title: 'Event 1',
    date: 'January 1, 2022',
  },
  {
    title: 'Event 2',
    date: 'February 1, 2022',
  },
  {
    title: 'Event 3',
    date: 'March 1, 2022',
  },
];

function Timeline() {
  return (
    <Chrono items={events} flipLayout />
  );
}

export default Timeline;
